import React, { Component } from 'react';
import '../CssComponent/info.css'
class info extends Component {
    state = {}
    render() {
        return (
            <div className='container'>
               <div className='info'>
                   <img className='one' src='Premium.png' style={{width: "50%", height: '50%' }}/>
                   <h1 className='six'>asad</h1>
               </div>
            </div>
        );
    }
}

export default info;
